import { Handle, Position } from 'reactflow';

export function InputNode() {
  return (
    <div style={{ padding: 10, border: '1px solid black', background: 'white' }}>
      <strong>Input Node</strong>
      <div>Input Value</div>

      {/* OUTPUT handle */}
      <Handle
        type="source"
        position={Position.Right}
      />
    </div>
  );
}
